import React from 'react';
import ReactDOM from 'react-dom';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';

const mapStyles = {
    width: '100vh',
    height: '100%'
}
   
class Dashboard extends React.Component {
    buttonClick(e){
        console.log(e.target);
    }
    
    render() {
        let cityList = [
            {
                id : 1, 
                name : 'Delhi',
                lat : '',
                lng : ''
            },
            {
                id : 2, 
                name : 'Mumbai',
                lat : '',
                lng : ''
            },
            {
                id : 3, 
                name : 'Kolkata',
                lat : '',
                lng : ''
            },
            {
                id : 4,
                name : 'Channai',
                lat : '',
                lng : ''
            },
            {
                id : 5,
                name : 'Pune',
                lat : '',
                lng : ''
            },
            {
                id : 6, 
                name : 'Bangalore',
                lat : '',
                lng : ''
            },
            {
                id : 7,
                name : 'Hyderabad',
                lat : '',
                lng : ''
            },
            {
                id : 8,
                name : 'Cochi',
                lat : '',
                lng : ''
            },       
    
        ];
        const cityNames = cityList.map(data => {
            return (
                <li onClick={this.buttonClick.bind(data)}>{data.name}</li>
            );
        })
        return (
            <div>
                <div>Hello User </div>
                <div style={{width: '50%', float : "left"}}>Lists Of Cities
                <ul>
                    {cityNames}
                </ul>
                </div>
                <div style={{width: '50%', float : "left" }}>
                <Map
                    google={this.props.google}
                    zoom={11}
                    style={mapStyles}
                    initialCenter={{ lat: 22.5726, lng: 88.3639 }}
                >
                    <Marker position={{ lat: 22.5726, lng: 88.3639 }} />
                </Map>
                </div>
            </div>
        );
    }
}
export default GoogleApiWrapper({
    apiKey: 'AIzaSyAwu42ZjnzWV4-LQe5-t72Ujt3OykdqZ_w'
  })(Dashboard);
